const imageBase = ''

function ocultarCantidad() {
    $('td:nth-child(5)').hide();
    $('th:nth-child(5)').hide();
  };

function ocultarCantidadAsesor() {
    $('td:nth-child(5)').hide();
    $('th:nth-child(5)').hide();
    $('td:nth-child(6)').hide();
    $('th:nth-child(6)').hide();
  };


function generate() {
    ocultarCantidad()
    var doc = new jsPDF('p', 'pt', 'a4');
    var htmlstring = '';
    var tempVarToCheckPageHeight = 0;
    var pageHeight = 0;
    var userPrint = document.getElementById('user').value
    pageHeight = doc.internal.pageSize.height;
    specialElementHandlers = {
        // element with id of "bypass" - jQuery style selector  
        '#bypassme': function (element, renderer) {
            // true = "handled elsewhere, bypass text extraction"  
            return true
        }
    };
    margins = {
        top: 150,
        bottom: 60,
        left: 40,
        right: 40,
        width: 600
    };
    var y = 20;
    doc.setLineWidth(2);
    
    doc.setFontSize(10);
    doc.setFont("helvetica");

    doc.text(150, y = y + 30, "Sistema de fortalecimiento autoevaluación y coevaluación docente");

    doc.text(60, y = y + 30, "Fecha y hora del reporte: " + new Date().toLocaleString());
    doc.text(60, y = y + 15, "Apellidos y nombres: " + userPrint);
    doc.text(60, y = y + 17, "Nombre del reporte:  Reporte de notas finales");

    doc.addImage(imageBase, 'png', 450, 65, 60, 60)

    doc.autoTable({
        html: '#tabla',
        startY: 140,
        theme: 'striped',
        columnStyles: {
            0: {
                cellWidth: 180,
                halign: 'center'
            },
            1: {
                cellWidth: 120,
                halign: 'center'
            },
            2: {
                cellWidth: 60,
                halign: 'center'
            },
            3: {
                cellWidth: 60,
                halign: 'center'
            },
            4: {
                cellWidth: 120,
                halign: 'center'
            },
        },
        styles: {
            minCellHeight: 40
        }
    })
    doc.save('Reporte_SecoedV2.pdf');
}

